import styled from 'styled-components';

export const Title = styled.p`
    color: #000000;
    font-family: "poppins";
    font-size: 40px;
`;
export const TitleContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items:center;
    width: 100%;
    height: 10%;
    margin: 20px 0px 20px 0px;
`;
